function App({ signOut, user }) {
  return (
    <div className='App'>
      <Header />
      <div id="user">
        <span>User Email: {user.attributes.email}</span>
        <button onClick={signOut}>Sign Out</button>
      </div>
      <InputFile />
      <Footer />
    </div>
  );
}

export default withAuthenticator(App);
